import React from "react";
import Header from "../layout/Header";
import Footer from "../layout/Footer";
import Contents from "../layout/Contents";




function Main() {
  return (
    <>
      <Header/>
      <Contents>
      <Slider/>
        <Image/>
        <ImgText/>
        <Card/>
        <Banner/>
        <Text/>
      </Contents>
      <Footer/>
    </>
  )
}

export default Main;
